// SignInPage.js
import React, { useState } from 'react';
import './PropertyForm.css';
import './SignInPage.css';

function SignInPage()  {
  const [FullName, setFullName] = useState('');
  const [Mobile, setMoble] = useState('');
  const [Email, setEmail] = useState('');
  const [password, setpassword] = useState('0');
  const [errorMessages, setErrorMessages] = useState({
    FullName: '',
    Mobile: '',
    Email: '',
    password: '',
  });

  const handleCombined = () => {
    handleProceed();
  };


  const handleProceed = () => {
    const isValid = validateInputs();
  }

  return (
    <div className='org'>
      
          <div className='form-container container'>
            <h2>SignIn forher</h2>
            <form className='forinner container'>
              <div className='form-group'>
                <label>FullName <span style={{ color: 'red' }}>*</span> :</label>
                <input
                  type='text'
                  className='form-control'
                  placeholder='ex : FullName'
                  value={FullName}
                  onChange={(e) => setFullName(e.target.value)}
                />
                <p className='error-message'>{errorMessages.currentMarketValue}</p>
              </div>

              <div className='form-group'>
                <label>Mobile <span style={{ color: 'red' }}>*</span> :</label>
                <input
                  type='text'
                  className='form-control'
                  placeholder='ex : 9876543210'
                  value={Mobile}
                  onChange={(e) => setMoble(e.target.value)}
                />
                <p className='error-message'>{errorMessages.carpetArea}</p>
              </div>

              <div className='form-group'>
                <label>Email <span style={{ color: 'red' }}>*</span> :</label>
                <input
                  type='text'
                  className='form-control'
                  placeholder='ex : example@gmail.com'
                  value={Email}
                  onChange={(e) => setEmail(e.target.value)}
                />
                <p className='error-message'>{errorMessages.Email}</p>
              </div>

              <div className='form-group'>
                <label>password <span style={{ color: 'red' }}>*</span> :</label>
                <input
                  type='text'
                  className='form-control'
                  placeholder='ex : Abc@123'
                  value={password}
                  onChange={(e) => setpassword(e.target.value)}
                />
                <p className='error-message'>{errorMessages.password}</p>
              </div>



              <button className='btn btn-success my-2' onClick={handleCombined}>
                SignIn
              </button>
            </form>
          </div>
    </div>
  );
}

export default SignInPage;
